// Imports
import styled from '@emotion/styled';

// Styles
const Global = styled.div`
  font-family: Arial, Helvetica, sans-serif;
  background-color: honeydew;
  color: seagreen;
  position: absolute;
  height: 100%;
  width: 100%;
`;

const Layout = styled.div`
  width: 50%;
  margin: auto;
  text-align: center;
  img {
    display: inline;
  }
  ul {
    padding-left: 0px;
    list-style-type: none;
  }
`;

// Contexts
import User from '../lib/React/UserContext';

// Components
import Meta from './Meta';
import Header from './Header';

const Page = (props) => (
  <Global>
    <Layout>
      <User>
        <Meta />
        <Header {...props} />
        {props.children}
      </User>
    </Layout>
  </Global>
);

export default Page;
